import React from 'react';

const Todo = props => {
  const { id, toggleComplete, todo, completed } = props;
  return (
    <div>
      <p style={{ textDecoration: completed ? 'line-through' : 'none' }}
      onClick={() => toggleComplete(id)}>{todo}</p>
    </div>
  );
};

export default Todo;
